import React from 'react';
import "../style/home.css";

function Home() {
  return (
    <section id="home">
      <header className='home_header'>
        <h3> Welcome to</h3>
        <div className='home_name'>
        <h1>Shelter XXII</h1>
        </div>
      </header>
    </section>
  )
}

export default Home
